/*
 * @Author: your name
 * @Date: 2022-03-31 23:07:52
 * @LastEditTime: 2022-04-02 14:09:39
 * @LastEditors: Please set LastEditors
 * @Description: 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 * @FilePath: \bl-device-manage-test\src\layouts\SpareManage\StandingPage\index.js
 */
import { inject, observer } from 'mobx-react'
import React, { Component } from 'react'
import { Table } from 'antd'


@inject('SpareStore')
@inject('HomeStore')
@observer
class StandingPage extends React.Component {
  render() {
    const { columns } = this.props.SpareStore;
    const { data } = this.props.SpareStore;
    const { model } = this.props.HomeStore;
    console.log(model);
    if (model == 'look') {
      return <Table columns={columns} dataSource={data}></Table>;
    } else {
      return <Form
        name="basic"
        labelCol={{ span: 8 }}
        wrapperCol={{ span: 16 }}
        initialValues={{ remember: true }}
        autoComplete="off"
      >
        <Form.Item
          label="Username"
          name="username"
          rules={[{ required: true, message: 'Please input your username!' }]}
        >
          <Input />
        </Form.Item>

        <Form.Item
          label="Password"
          name="password"
          rules={[{ required: true, message: 'Please input your password!' }]}
        >
          <Input.Password />
        </Form.Item>

        <Form.Item name="remember" valuePropName="checked" wrapperCol={{ offset: 8, span: 16 }}>
          <Checkbox>Remember me</Checkbox>
        </Form.Item>

        <Form.Item wrapperCol={{ offset: 8, span: 16 }}>
          <Button type="primary" htmlType="submit">
            Submit
          </Button>
        </Form.Item>
      </Form>

    }


  }
}

export default StandingPage;
